import React from 'react';
import './classCss.css';
import {  Link } from 'react-router-dom';
import {rootConstants} from '../_constants';
import { connect } from 'react-redux';
import  history  from '../_store/history';
import schoolData from '../_data/schoolData';
import PlanPrint from '../_components/_lessonPlan/planPrint';
import {allActions} from '../_actions'

import { render } from 'react-dom';
import { layoutLarge, layoutMedium } from './constants.js';

import { Responsive , GridLayout} from 'react-grid-layout';
import WidthProvider from '../_components/_lessonPlan/WidthProvider';

const ResponsiveGridLayout = WidthProvider(Responsive);

class classScreen extends React.Component  {
    constructor() {
      super();
      this.state = {
        name: 'React',
        layouts: {lg: layoutLarge, md: layoutMedium}
      };
    }

    onLayoutChange(layout, newLayout) {
      this.setState({ layouts: newLayout });
    }

    render() {
      return (
        <ResponsiveGridLayout
            layouts={this.state.layouts}
            breakpoints={{ lg: 1100, md: 768 }}
            onLayoutChange={(layout, newLayout) =>
                this.onLayoutChange(layout, newLayout)}>
            <div key="1" className="box">...</div>
            <div key="2" className="box">...</div>
            <div key="3" className="box">...</div>
            <CustomComponent key="4" />
        </ResponsiveGridLayout>
      );
    }
}

export class CustomComponent extends React.Component  {
    render() {
      return (
        <div {...this.props} className={`wrapper ${this.props.className}`}>
          Hello
        </div>
      );
    }
}
export default connect(allActions.mapStateToProps,allActions.mapDispatchToProps)(classScreen);
